import { Monitor, Cpu } from "lucide-react";


const SystemDesign = () => {
  const topics = [
    { name: "Scalability & Load Balancing", desc: "Learn horizontal & vertical scaling, load balancers.", icon: <Monitor className="w-10 h-10 text-indigo-600"/>, path: "/placement-prep/core-subjects/system-design/scalability", color: "from-indigo-100 to-indigo-50" },
    { name: "Caching & DB Sharding", desc: "Understand caching strategies and database sharding.", icon: <Cpu className="w-10 h-10 text-blue-600"/>, path: "/placement-prep/core-subjects/system-design/caching", color: "from-blue-100 to-blue-50" },
  ];

  return (
    <SubjectPage
      title="System Design Preparation"
      description="Explore designing scalable systems with caching, sharding, and load balancing."
      topics={topics}
    />
  );
};

export default SystemDesign;
